class Solution {
    public int climbStairs(int n) {
        if(n<=2){
            return n;
        }
        int a = 1,b = 2,result = 0;
        for(int i = 3;i<=n;i++){
            result = a+b;
            a = b;
            b = result;
        }
        return result;
    }
}

class Solution:
    def climbStairs(self, n: int) -> int:
        if n <= 2 :
            return n 
        nl = [0]*(n+1)
        nl[1] = 1 
        nl[2] = 2

        for i in range ( 3 , n+1):
            nl[i]  = nl[i-1] +nl[i-2]
        return nl[n]

class Solution:
    def climbStairs(self, n: int) -> int:
        steps = 0
        if n == 1:
            return 1
        hashmap = {}
        k = n
        #climbing 
        def climb(k):
            if k in hashmap:
                return hashmap[k]
            if k == 1:
                return 1
            if k == 2:
                return 2
            if k not in hashmap:
                hashmap[k] = climb(k-1) + climb(k-2)
            return climb(k-1)+climb(k-2)

        steps += climb(k)
        return steps

class Solution:
    def climbStairs(self, n: int) -> int:
        if(n==0): return 0
        else:
            a,b,s = 0,1,0
            for i in range(n):
                s = a+b
                a = b
                b = s
        return s

class Solution(object):
    def climbStairs(self, n):
        a,b=0,1
        for i in range(2,n+2):
            a,b=b,a+b
        return b

class Solution {
    public int climbStairs(int n) {
        int a = 1;
        int b = 2;
        if(n <= 2)
        {
            return n;
        }
        else 
        {
            for(int i=2;i<n;i++)
            {
                int c = a+b;
                a = b;
                b = c;
            }
            return b;
        }
